import React from 'react'
import {View,TouchableOpacity,Text,Image,ImageBackground, FlatList} from 'react-native'
import info from './info'
import ImageContainer from './example'


const Hotels = ()=> {
    return(
        <>
        <View>
            <FlatList
            data={info.hotels}
            renderItem={({item})=>{
                return <ImageContainer key={item.id} hotels={item} />
                
            }}
            horizontal={true}
           keyExtractor={item=>item.id}
            />
        </View>
        </>
    )
}
export default Hotels
